    render(){
        return(
        <div className = 'directory-menu'> 
            {this.state.sections.map(({title,imageUrl,id}) => {
                return <MenuItem key={id} title={title.toUpperCase()} imageUrl={imageUrl} size={size}/>;
            })};
        </div>
        )
    }
}
export default Directory;
